in_source: |-
  (begin
      (setq buf (alloc 200))
    (setq first_value 0)
    (setq last_value 9999999)

      (setq i 0)
      (setq num input)
      (store (+ buf i) num)
      (store (+ buf (+ i 1)) (+ buf (+ i 2)))
      (while (!= num 0)
          (setq i (+ i 2))
          (setq num input)
          (store (+ buf i) num)
          (store (+ buf (+ i 1)) (+ buf (+ i 2)))
      )

    (setq temp buf)
    (setq sorted (cons first_value 0))
    (setq saved sorted)
    (insert last_value sorted)

    (while (!= (deref buf) 0)
      (setq sorted saved)
      (while (> (deref buf) (deref (cdr sorted)))
        (setq sorted (cdr sorted))
      )
      (insert (deref buf) sorted)
      (setq buf (cdr buf))
    )

      (while (!= saved 0)
          (print (deref (car saved)))
          (setq saved (cdr saved))
      )
  )
